import React, { Component } from "react";
import { Navbar, Nav } from "react-bootstrap";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

import Educators from "./Educators";
import Students from "./Students";
import Schools from "./Schools";
import Logout from "./Logout";
import CreateStudent from "./Createstudents";
import CreateEducator from "./CreateEducators";
import CreateSchool from "./Createschools";
import UpdateStudent from "./Updatestudents";
import Deletestudents from "./Deletestudents";
import UpdateEducator from "./UpdateEducators";
import UpdateSchool from "./Updateschools";
import DeleteEductors from "./Deleteeductors";
import DeleteSchools from "./Deleteschools";

export default class NavbarComp extends Component {
  render() {
    return (
      <Router>
        <div>
          <Navbar bg="dark" variant={"dark"} expand="lg">
            <Navbar.Brand href="#">E-Masomo</Navbar.Brand>
            <Navbar.Toggle aria-controls="navbarScroll" />
            <Navbar.Collapse id="navbarScroll">
              <Nav
                className="ms-auto my-2 my-lg-0"
                style={{ maxHeight: "100px" }}
                navbarScroll
              >
                <Nav.Link as={Link} to="/logout">
                  Logout
                </Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Navbar>
        </div>
        <div>
            <Routes>
            <Route path="/" element={<Educators/>} />
              <Route path="/educators" element={<Educators/>} />
              <Route path="/create" element={<CreateEducator />} />
              <Route path="/update" element={<UpdateEducator/>} />
              <Route path="/delete" element={<DeleteEductors />} />
              <Route path="/students" element={<Students />} />
              <Route path="/create" element={<CreateStudent />} />
              <Route path="/update" element={<UpdateStudent />} />
              <Route path="/delete" element={<Deletestudents/>} />
              <Route path="/schools" element={<Schools />} />
              <Route path="/create" element={<CreateSchool />} />
              <Route path="/update" element={<UpdateSchool />} />
              <Route path="/delete" element={<DeleteSchools/>} />
              <Route path="/logout" element={<Logout/>} />

            </Routes>

        </div>
      </Router>
    );
  }
}
